CREATE TABLE "vendas" (
  idVenda integer primary key,
  idCliente integer,
  nome varchar(255),
  sexo varchar(255),
  cidade varchar(255),
  estado varchar(50),
  carro varchar(255),
  cor varchar(255),
  datavenda varchar(255),
  vendedor varchar(255),
  valorbruto decimal(10,2),
  valordesconto decimal(10,2)
);

